def find_zero(xs: list):
    if len(xs) % 2 != 0 or not xs[-1]:
        raise ValueError
    a, b = -1, 1
    while poly(xs, a) * poly(xs, b) > 0:
        if abs(poly(xs, a)) > abs(poly(xs, b)):
            b *= 2
        else:
            a *= 2
    for _ in range(100):
        mid = (a + b) / 2
        if poly(xs, mid) == 0:
            return mid
        if poly(xs, a) * poly(xs, mid) < 0:
            b = mid
        else:
            a = mid
    return (a + b) / 2

def find_zero(xs: list):
    if len(xs) % 2 != 0 or not xs[-1]:
        return None

    left = -1000
    right = 1000

    while abs(right - left) > 1e-10:
        mid = (left + right) / 2
        val = poly(xs, mid)

        if abs(val) < 1e-10:
            return mid

        if val * poly(xs, left) < 0:
            right = mid
        else:
            left = mid

    return (left + right) / 2

