def change_base(x: int, base: int):
    if x == 0:
        return '0'
    result = ''
    num = abs(x)
    while num > 0:
        result = str(num % base) + result
        num //= base
    return '-' + result if x < 0 else result

def change_base(x: int, base: int):
    if x == 0:
        return '0'
    digits = []
    while x:
        digits.append(str(x % base))
        x //= base
    return ''.join(digits[::-1])

