def fib4(n: int):
    if n < 0:
        raise ValueError("n must be non-negative")
    if n <= 1:
        return 0
    if n == 2:
        return 2
    if n == 3:
        return 0

    a, b, c, d = 0, 2, 0, 4
    for _ in range(4, n):
        a, b, c, d = b, c, d, a + b + c + d

    return d

